REGION Define current, next and prev points
        //Some of pumps is running
        #t_SomePumpIsRunning := #t_Pump1_Obj_HMI.Status.dw_STW.%X6
        OR #t_Pump2_Obj_HMI.Status.dw_STW.%X6
        OR #t_Pump3_Obj_HMI.Status.dw_STW.%X6;

        IF NOT #t_SomePumpIsRunning
        THEN
            #si_CurrentPoint := -1;
            FOR #ti_Cnt := 0 TO 2 DO
                IF #t_AutoControl_Pumps.Arr[#ti_Cnt].i_Priority = 1
                    AND #t_AutoControl_Pumps.Arr[#ti_Cnt].Enabled
                THEN
                    #si_CurrentPoint := #t_AutoControl_Pumps.Arr[#ti_Cnt].i_Priority;
                END_IF;
            END_FOR;
        ELSE
            //Define points for go up
            IF #s_EdgeUp.QB_EdgePos
            THEN
                #si_CurrentPoint := #si_CurrentPoint;
                FOR #ti_Cnt := 0 TO 2 DO
                    IF #t_AutoControl_Pumps.Arr[#ti_Cnt].i_Priority >= (#si_CurrentPoint + 1)
                        AND #t_AutoControl_Pumps.Arr[#ti_Cnt].Enabled
                        AND #t_AutoControl_Pumps.Arr[#ti_Cnt].AutoControl_P.STW_HMI.%X25
                        AND #t_AutoControl_Pumps.Arr[#ti_Cnt].AutoControl_P.STW_HMI.%X1
                    THEN
                        #si_CurrentPoint := #t_AutoControl_Pumps.Arr[#ti_Cnt].i_Priority;
                        #t_Obj_PIDCon.r_IntegralSum := #IR_MinOut - #t_Obj_PIDCon.r_Gain * (#t_Obj_PIDCon.r_Setpoint - #t_Obj_PIDCon.r_Input);
                        #tr_PID_Out := #IR_MinOut;
                        #t_Obj_PIDCon.SetIntegralSum := true;
                        EXIT;
                    END_IF;
                END_FOR;
            END_IF;

            //Define points for go dwn
            IF #s_EdgeDwn.QB_EdgePos
            THEN
                #si_CurrentPoint := #si_CurrentPoint;
                FOR #ti_Cnt := 0 TO 2 DO
                    IF #t_AutoControl_Pumps.Arr[#ti_Cnt].i_Priority <= (#si_CurrentPoint - 1)
                        AND #t_AutoControl_Pumps.Arr[#ti_Cnt].Enabled
                        AND #t_AutoControl_Pumps.Arr[#ti_Cnt].AutoControl_P.STW_HMI.%X25
                        AND #t_AutoControl_Pumps.Arr[#ti_Cnt].AutoControl_P.STW_HMI.%X1
                    THEN
                        #si_CurrentPoint := #t_AutoControl_Pumps.Arr[#ti_Cnt].i_Priority;
                        #t_Obj_PIDCon.r_IntegralSum := #IR_MaxOut - #t_Obj_PIDCon.r_Gain * (#t_Obj_PIDCon.r_Setpoint - #t_Obj_PIDCon.r_Input);
                        #tr_PID_Out := #IR_MaxOut;
                        #t_Obj_PIDCon.SetIntegralSum := true;
                        EXIT;
                    END_IF;
                END_FOR;
            END_IF;
        END_IF;
    END_REGION
